# data cleaning
dataset = dataset[(dataset['X Coordinate'] != ' ') & (dataset['Y Coordinate'] != ' ')]
dataset = dataset.dropna()
dataset['X Coordinate'] = dataset['X Coordinate'].astype(int)-7
dataset['Y Coordinate'] = 525 - dataset['Y Coordinate'].astype(int)
dataset = dataset.drop_duplicates(subset = ['ATACQ Item English Desc', 'Link Timestamp', 'X Coordinate', 'Y Coordinate'])

# plots
total_plots = min(3, dataset['ATACQ Item English Desc'].value_counts().shape[0])
if (dataset['ATACQ Item English Desc'].value_counts().shape[0] == 0):
    temp_string = "No data available"
    # print(time_string)
    matplotlib.pyplot.text(0.2, 0.5, temp_string, size=16)
    matplotlib.pyplot.axis('off')
else:
    fig, ax = matplotlib.pyplot.subplots(total_plots, 1)
    fig.set_figwidth(4)
    fig.set_figheight(total_plots * 2.5)
    fig.set_dpi(130)

    for i in range(total_plots):
    #Most common:
        ax = matplotlib.pyplot.subplot(total_plots, 1, i+1)

        d_plot = dataset.loc[dataset['ATACQ Item English Desc'] == dataset['ATACQ Item English Desc'].value_counts().index[i]]
        
        title = dataset['ATACQ Item English Desc'].value_counts().index[i].lower().capitalize() + ", " + str(dataset['ATACQ Item English Desc'].value_counts()[i]) + " defects"
        ax.title.set_text(title)
        
        if Background:
            ax.imshow(img, extent=[0, 715, 0, 515])
        
        # if defect count is over 100 use heatmap, else scatter plot
        if (dataset['ATACQ Item English Desc'].value_counts()[i] > 100):
            sns.histplot(x = d_plot['X Coordinate'], y = d_plot['Y Coordinate'], bins = int(8 + 24/(i+1)), ax=ax, alpha = 0.75, pthresh=-0.15, pmax=0.8 + 0.1*i, cbar = True, cmap = "hot_r", thresh = -0.1)
        else:
            ax.scatter(x=d_plot['X Coordinate'], y=d_plot['Y Coordinate'], s=64, c='r', edgecolors='yellow')
            
        ax.axis('off')


matplotlib.pyplot.tight_layout()
matplotlib.pyplot.show()
